import React, { Component } from 'react';

import Nav from '../components/Nav';
import Banner from '../components/Banner';

class Header extends React.Component {
    render() {
        return (
            <header>
                <Nav/>
                <section class="content">
                    <Banner/>
                </section>
            </header>
        )
    }
}
export default Header
